import "../topo/topo.css";
import Busca from "./busca";

function Topo() {
  return (
    <div className="topo">
      <div className="logo">
        <h1>
          <span style={{ color: "#a1aaae" }}>Doc.</span>&nbsp;
          <span style={{ color: "#01648f" }}>API</span>
        </h1>
      </div>
      <Busca></Busca>
    </div>
  );
}

export default Topo;
